/*
 * Compute NTT on a ring element.
 */
void ntt(S_Q_SIZE *a, unsigned logn)
{
  // To be revieweid (Add refference)
  size_t n, t, m;

  n = (size_t)1 << logn;
  t = n;
  for (m = 1; m < n; m <<= 1)
  {
    size_t ht, i, j1;

    ht = t >> 1;
    for (i = 0, j1 = 0; i < m; i++, j1 += t)
    {
      size_t j, j2;
      S_DOUBLE_Q_SIZE s;

      s = GMb[m + i];
      j2 = j1 + ht;
      for (j = j1; j < j2; j++)
      {
        S_DOUBLE_Q_SIZE u, v;

        u = a[j];
        v = montymul(a[j + ht], s);
        a[j] = (S_Q_SIZE)add(u, v);
        a[j + ht] = (S_Q_SIZE)sub(u, v);
      }
    }
    t = ht;
  }
}

/*
 * Compute the inverse NTT on a ring element, binary case.
 */
void invntt_tomont(S_Q_SIZE *a, unsigned logn)
{
  // To be revieweid (Add refference)
  size_t n, t, m;
  S_DOUBLE_Q_SIZE ni;

  n = (size_t)1 << logn;
  t = 1;
  m = n;
  while (m > 1)
  {
    size_t hm, dt, i, j1;

    hm = m >> 1;
    dt = t << 1;
    for (i = 0, j1 = 0; i < hm; i++, j1 += dt)
    {
      size_t j, j2;
      S_DOUBLE_Q_SIZE s;

      j2 = j1 + t;
      s = iGMb[hm + i];
      for (j = j1; j < j2; j++)
      {
        S_DOUBLE_Q_SIZE u, v, w;

        u = a[j];
        v = a[j + t];
        a[j] = (S_Q_SIZE)add(u, v);
        w = sub(u, v);
        a[j + t] = (S_Q_SIZE)montymul(w, s);
      }
    }
    t = dt;
    m = hm;
  }

  ni = R;
  for (m = n; m > 1; m >>= 1)
  {
    ni = rshift1(ni);
  }
  for (m = 0; m < n; m++)
  {
    a[m] = (S_Q_SIZE)montymul(a[m], ni);
  }
}

/*************************************************
 * Name:        fqmul
 *
 * Description: Multiplication followed by Montgomery reduction
 *
 * Arguments:   - S_Q_SIZE a: first factor
 *              - S_Q_SIZE b: second factor
 *
 * Returns 16-bit integer congruent to a*b*R^{-1} mod q
 **************************************************/
static S_Q_SIZE fqmul(S_Q_SIZE a, S_Q_SIZE b)
{
  return reduce((int32_t)a * b);
}

/*************************************************
 * Name:        basemul
 *
 * Description: Multiplication of polynomials in Zq[X]/(X^2-zeta)
 *              used for multiplication of elements in Rq in NTT domain
 *
 * Arguments:   - S_Q_SIZE r[2]:       pointer to the output polynomial
 *              - const S_Q_SIZE a[2]: pointer to the first factor
 *              - const S_Q_SIZE b[2]: pointer to the second factor
 *              - S_Q_SIZE zeta:       integer defining the reduction polynomial
 **************************************************/
void basemul(S_Q_SIZE r[2],
             const S_Q_SIZE a[2],
             const S_Q_SIZE b[2],
             S_Q_SIZE zeta)
{
  r[0] = fqmul(a[1], b[1]);
  r[0] = fqmul(r[0], zeta);
  r[0] += fqmul(a[0], b[0]);

  r[1] = fqmul(a[0], b[1]);
  r[1] += fqmul(a[1], b[0]);
}